############ in this experiment the design changes by scaling the POINTS in layers through interaction  ############

def distance(pointA, pointB):
    d = (pointA[0] - pointB[0]) ** 2 + (pointA[1] - pointB[1]) ** 2 + (pointA[2] - pointB[2]) ** 2
    d = math.sqrt(d)
    return d


def remap(x, xmin, xmax, targetMin, targetMax):
    if x <= xmin: return targetMin
    if x >= xmax: return targetMax
    return (x - xmin) / (xmax - xmin) * (targetMax - targetMin) + targetMin


def createPointinRobotSpace(y, z):
    y = y * 20
    z = z * 20
    z = z + 400
    return y, z


def normalizeVec(vec):
    return vec / np.linalg.norm(vec)


###########################################################################################################################
def checkX(x):
    if x < 200:
        return 200
    elif x > 500:
        return 500
    else:
        return x


def checkY(y):
    if y < -450:
        return -450
    elif y > 450:
        return 450
    else:
        return y


def checkZ(z):
    if z < 160:
        return 160
    elif z > 550:
        return 550
    else:
        return z

# refrence point is the point that you do the scaling in relation to the distance from that
# retuens the scaled result point - points are tuples in the form of (x,y,z)
def scaleY(point, ref_point, scaleY):
    dY = point[1] - ref_point[1]
    dY_r = dY * scaleY
    resultY = (point[0],ref_point[1] + dY_r ,point[2])
    return resultY

def scaleZ(point, ref_point, scaleZ):
    dZ = point[2] - ref_point[2]
    dZ_r = dZ * scaleZ
    resultZ = (point[0], point[1], ref_point[2] + dZ_r)
    return resultZ

